// ____________________________________________________________________________________________________
//
//     JS module handling
// ____________________________________________________________________________________________________
//

// Valve's javscript module IDs are not stable between different builds of the steam website
// Our core collection of .js files (friends.js, libraries.js, libraries_cms.js, etc) is a homogenous snapshot of 1 build, so the module IDs baked into it are fine and work without incident
// But problems happen when we fetch remote resources from Valve's servers, because Valve only serves bleeding edge versions and the module IDs will be different in those versions
// For example, shared_english-json is 84075 in build 8200419 (late July 2023), but it's 48751 in build 8371134 (Sept 26 2023), which is the live current build of the steam website as of Sept 26

class JsModuleInfo
{
	constructor(name, id1, id2s)
	{
		this.Name = name
		
		this.Id1 = id1
		
		this.Id2s = id2s.sort( (a, b) => (a[0] > b[0]) )
		this.Id2sByBuild = {}
		for (let item of id2s) {
			this.Id2sByBuild[item[0]] = item[1] }
	}
	
	GetId2For(build)
	{
		return this.Id2sByBuild[build]
	}
	
	GetEarliestId2()
	{
		return this.Id2s[0][1]
	}
	
	GetId2OrClosestEarlierFor(build)
	{
		let id2 = this.GetId2For(build)
		
		if (id2 == null)
		{
			let item = this.Id2s[0]
			for (let i = 1; i < this.Id2s.length; i++)
			{
				let laterItem = this.Id2s[i]
				if (laterItem[0] <= build) {
					item = laterItem }
				else {
					break }
			}
			id2 = item[1]
		}
		
		return id2
	}
}

function buildKnownJsModules(raw)
{
	let result = {}
	raw.forEach((item, index) => {
		symbolName = item[0]
		id1 = item[1]
		id2s = item[2]
		result[symbolName] = new JsModuleInfo(symbolName, id1, id2s)
	})
	return result
}

let KnownJsModules = buildKnownJsModules(StaticDataJson5.KnownJsModules)



