//     CDN asset path handling
// ____________________________________________________________________________________________________
//

// Instead of getting assets from community.<cdn>.steamstatic.com/VALVE_PUBLIC_PATH, we can the local copies I manually downloaded and included in steam-chat.com-snapshot
// For only the very core js files, I was able to recover circa July 2023 versions of them from the steamwebhelper cef cache on one of my PCs
// For all other files, Valve has already unfortunately redacted the circa July 2023 versions of them, so the local copies I downloaded are thus unfortunately post Sept 21
// But these post Sept 21 versions are probably fine, since afaik the only file Valve fucked up in the Sept 21 pwa update was friends.js

let CdnAssetCategory = CreateEnum([
	"MainJs", // .js that is actually js
	"JsonJs", // .js that is a hideous overglorified wrapper around some valid or invalid json
	"LibraryJs", // lesser .js libraries, not directly related to steam friends
	"Css",
	"Images",
	"Sounds"
])

let CdnAssetForceHost = CreateEnum([
	"None",
	"Local",
	"Remote",
])

let CdnAssetRootPathType = CreateEnum([
	"Root", // rootmost directory
	"RootPublic", // root/public directory
	// This distinction is necessary since the Valve friends.js code is inconsistent in how it builds URL strings
	// - Somestimes it leaves the /public folder out of the root, like: COMMUNITY_URL + "public/sounds/etc"
	// - Other times it expectes the /public folder to be in the root, like: VALVE_PUBLIC_PATH + "javascript/etc"
])

var UseLocalAssetCopies =
{
	// JS modules
	// Must use local copies due to instability between builds in Valve's js module IDs
	[CdnAssetCategory.MainJs]: true,
	[CdnAssetCategory.JsonJs]: true,
	
	[CdnAssetCategory.LibraryJs]: true, // safer to use library versions that are contemporary to ourself (this 8200419 version of friends.js) rather than Valve's remote bleeding edge
	
	[CdnAssetCategory.Css]: true, // same rationale as LibraryJs
	
	[CdnAssetCategory.Images]: true, // false is safe until valve eventually redacts the files we request, but why take that risk?
	[CdnAssetCategory.Sounds]: true, // ditto
	
	// Note: all assets referenced outside of this friends.js file (like all the .png files in /public/shared/css/shared_global.css) will always be retrieved from remote
}

var LocalAssetFallbackToRemote = true
// If a local asset does not exist and we want the local asset, try to fetch the remote version instead

///// Abstraction wrapper for redirecting CDN assets to our local copies instead of getting them from the internet
function ResolveCdnAssetPath(webRoot, filePath, rootPathType, assetCategory, forceHost = CdnAssetForceHost.None)
{
	let local = false
	if (forceHost == CdnAssetForceHost.Local) {
		local = true }
	else if (forceHost == CdnAssetForceHost.None) {
		local = UseLocalAssetCopies[assetCategory] }
	else {
		throw new Error("Invalid value for param assetCategory"); }
	
	if (local)
	{
		let assetPath = null
		if (rootPathType == CdnAssetRootPathType.Root)
		{
			console.log("Use LOCAL (root/public) asset: ", webRoot, filePath, CdnAssetCategory[assetCategory])
			assetPath = LOCAL_ROOT + filePath
		}
		else if (rootPathType == CdnAssetRootPathType.RootPublic)
		{
			console.log("Use LOCAL (root) asset: ", webRoot, filePath, CdnAssetCategory[assetCategory])
			assetPath = LOCAL_VALVE_PUBLIC_PATH + filePath
		}
		else {
			throw new Error("Invalid value for param rootPathType"); }
		
		if (LocalAssetFallbackToRemote) // verify that the local asset can be retrieved; if not, use remote asset instead
		{
			let xhr = new XMLHttpRequest()
			xhr.open("GET", assetPath, false) // we must do this synchronously
			xhr.send()
			if (xhr.status >= 400)
			{
				assetPath = webRoot + filePath
				console.log("- Local asset not found (" + xhr.status + "); using fallback to remote path instead: " + assetPath)
			}
		}
		
		console.log("- Local path: " + assetPath)
		return assetPath
	}
	else
	{
		console.log("Use REMOTE asset: ", webRoot, filePath, CdnAssetCategory[assetCategory])
		return webRoot + filePath
	}	
}




